// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.16 < 0.9.0;

import "./CZH.sol";
import "./LFJ.sol";

contract EthSwap {
    string public name = "Eth swap platform contract";
    CZH public tokenCZH;
    LFJ public tokenLFJ;
    uint public rate = 100; // 100 CZH = 1 ETH
    uint public czhTokenBalance;
    uint public lfjTokenBalance;

    event TokensPurchased(
        address account,
        address token,
        uint amount,
        uint rate
    );

    event TokensSold(
        address account,
        address token,
        uint amount,
        uint rate
    );

    constructor(CZH _token1, LFJ _token2) {
        tokenCZH = _token1;
        tokenLFJ = _token2;
        czhTokenBalance = tokenCZH.balanceOf(address(this));
        lfjTokenBalance = tokenLFJ.balanceOf(address(this));
    }

    function buyTokens() public payable {
        // Calculate the number of tokens to buy
        uint tokenAmount = msg.value * rate;

        // Require that EthSwap has enough tokens
        require(tokenCZH.balanceOf(address(this)) >= tokenAmount, "Not enough CZH available to buy");

        // Transfer tokens to the user
        tokenCZH.transfer(msg.sender, tokenAmount);

        // Emit an event
        emit TokensPurchased(msg.sender, address(tokenCZH), tokenAmount, rate);
    }

    function sellTokens(uint _amount) public payable {
        // User can't sell more tokens than they have
        require(tokenCZH.balanceOf(msg.sender) >= _amount, "You can not sell more tokens than you currently hold");

        // Calculate the amount of Ether to redeem
        uint etherAmount = _amount / rate;

        // Require that EthSwap has enough Ether
        require(address(this).balance >= etherAmount, "Swap contract does not have enough available ETH amount");

        // Perform sale
        tokenCZH.transferFrom(msg.sender, address(this), _amount);
        payable(msg.sender).transfer(etherAmount);

        // Emit an event
        emit TokensSold(msg.sender, address(tokenCZH), _amount, rate);
    }

}
